import styled from 'styled-components'

export const Layout = styled.div`
  width: 100%;
`

export const TitleContainer = styled.div`
  display: flex;
  flex-flow: row nowrap;
  height: 3rem;
  padding: 1rem 0rem;
  align-items: center;
`

export const Logo = styled.img`
  height: 3rem;
`

export const Title = styled.div`
  color: blue;
  font-size: 1.5rem;
  font-weight: 600;
`
